import React from 'react';

export default function Team() {
  // 각 카드별 텍스트 자리 (첫번째: ㅁㅁ, 두번째: ㅇㅇ, 세번째: ㄱㄱ)
  const placeholders = ['ㅁㅁ', 'ㅇㅇ', 'ㄱㄱ'];

  return (
    <div className="container mx-auto px-8 py-12">
      <h1 className="text-4xl font-bold mb-8 text-center">팀원 소개</h1>
      <div className="flex flex-wrap justify-center gap-8">
        {placeholders.map((text, index) => (
          <div
            key={index}
            className="bg-white rounded-lg shadow-md w-64 h-96 p-4 flex flex-col items-center"
          >
            {/* 이미지 자리 (위쪽 중앙) */}
            <div className="w-32 h-32 bg-gray-200 rounded-lg mb-4" />

            {/* 텍스트 자리 (아래쪽, 3줄) */}
            <div className="mt-auto text-center space-y-2">
              <p>{text}</p>
              <p>{text}</p>
              <p>{text}</p>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
